import React, { useState } from 'react';

function SymptomList() {
  const [symptoms, setSymptoms] = useState([
    { name: 'Fever', description: 'High body temperature' },
    { name: 'Headache', description: 'Aching or pain in the head' },
    { name: 'Cough', description: 'Expelling air from the lungs with a sudden sharp sound' },
    // Add more pre-existing symptoms here
  ]);
  const [newSymptomName, setNewSymptomName] = useState('');
  const [newSymptomDescription, setNewSymptomDescription] = useState('');

  const handleAddSymptom = () => {
    const newSymptom = { name: newSymptomName, description: newSymptomDescription };
    setSymptoms([...symptoms, newSymptom]);
    setNewSymptomName('');
    setNewSymptomDescription('');
  };

  return (
    <div className="symptom-list">
      <h3>Symptoms:</h3>
      <ul>
        {symptoms.map((symptom, index) => (
          <li key={index}>
            <strong>{symptom.name}</strong> - {symptom.description}
          </li>
        ))}
      </ul>
      <div className="add-symptom">
        <input
          type="text"
          placeholder="Symptom Name"
          value={newSymptomName}
          onChange={(e) => setNewSymptomName(e.target.value)}
        />
        <input
          type="text"
          placeholder="Symptom Description"
          value={newSymptomDescription}
          onChange={(e) => setNewSymptomDescription(e.target.value)}
        />
        <button onClick={handleAddSymptom}>Add</button>
      </div>
    </div>
  );
}

export default SymptomList;
